// src/TradeAlerts.ts
import { Plugin } from "@ryelite/core";
import { SettingsTypes } from "@ryelite/core";
import { NotificationManager } from "@ryelite/core";
import { SoundManager } from "@ryelite/core";

// resources/sounds/trade_alert.mp3
var trade_alert_default = "data:audio/mpeg;base64,";

// src/TradeAlerts.ts
var TradeAlerts = class extends Plugin {
  constructor() {
    super();
    this.pluginName = "Trade Alerts";
    this.author = "Highlite";
    this.notificationManager = new NotificationManager();
    this.soundManager = new SoundManager();
    this.settings.volume = {
      text: "Volume",
      type: SettingsTypes.range,
      value: 50,
      min: 0,
      max: 100,
      callback: () => Function("NOOP")
    };
    this.settings.notification = {
      text: "Notification",
      type: SettingsTypes.checkbox,
      value: false,
      callback: () => Function("NOOP")
    };
    this.settings.sound = {
      text: "Sound",
      type: SettingsTypes.checkbox,
      value: true,
      callback: () => Function("NOOP")
    };
  }
  start() {
    this.log("Started");
  }
  stop() {
    this.log("Stopped");
  }
  init() {
    this.log("Initialized");
  }
  SocketManager_handleTradeRequestedPacket(players) {
    if (players[0] !== this.gameHooks.EntityManager.Instance.MainPlayer.EntityID && players.includes(
      this.gameHooks.EntityManager.Instance.MainPlayer.EntityID
    )) {
      if (this.settings.notification?.value) {
        this.gameHooks.EntityManager.Instance.Players.forEach(
          (player) => {
            if (player.EntityID === players[0]) {
              this.notificationManager.createNotification(
                "You have received a trade request from " + player.Name
              );
              return;
            }
          }
        );
      }
      if (this.settings.sound?.value) {
        this.soundManager.playSound(
          trade_alert_default,
          this.settings.volume?.value / 100
        );
      }
    }
  }
};
export {
  TradeAlerts as default
};
